var nameofcard, reviewfront, oldreviewfront;

var replaceKeywords = function() {	
	// Question side
	if ($(".review-card__front").length == 1) {
		//console.log("doing reviews and is ", nameofcard, " front");
		//underescore already used in app, but different version without _.findWhere
		var kanji = _.find(nc, {n: nameofcard}).c
		if (kanji != undefined) {
			for (let i = 0; i < kanji.length; i++) {
				engkey = " "+ _.find(ke, {k: kanji[i]}).e;
				var sentence = $(".review-card__front > .card-sentence").eq(0);
				var newsent = sentence.html().replace(engkey, " "+ kanji[i]); // including extra spaces here and in engkey because of KK363 "art" of "central-part" being replaced. Works because first word doesn't need replaced. Can't add space after word, because may be at end of sentence.
				sentence.html(newsent);
			}
		}
		
	}
	
	// Answer side
	if ($(".review-card__back").length == 1) {
		//console.log("doing reviews and is ", nameofcard, " back");
		var kanji = _.find(nc, {n: nameofcard}).c
		if (kanji != undefined) {
			for (let i = 0; i < kanji.length; i++) {
				engkey =  " "+ _.find(ke, {k: kanji[i]}).e;
				var sentence = $(".review-card__front > .card-sentence").eq(1);
				var newsent = sentence.html().replace(engkey, ' <span class="has-keyword" data-keyword="' + kanji[i] + 'kan">' + kanji[i] + '</span>' );
				sentence.html(newsent);
			}
		}
	}
}

MutationObserver = window.MutationObserver || window.WebKitMutationObserver;

	var observer = new MutationObserver(function(mutations){
		mutations.forEach(function(mutation) {
			//console.log(mutation.type);
				reviewfront = $(".review-card__front").length;
				nameofcard = $(".review-card__front .card-position").eq(0).text().trim();
				
				// if KK card
				if ( reviewfront && reviewfront != oldreviewfront && nameofcard.indexOf("KK") != -1 )
					replaceKeywords();
				
				oldreviewfront = reviewfront;
		});
	});

var target = $("#app");
var config = { attributes: true, childList: true, characterData: true, subtree: true };

observer.observe(target[0], config);

console.log("Keyword Replacer observer started");
